class Costanti {

    static get ALL() {
        return "all";
    }

    static get PARTENZA() {
        return "Partenza";
    }

    static get ARRIVO() {
        return "Arrivo";
    }

    static get DURATA() {
        return "Durata";
    }

}

export default Costanti;
